import React from 'react';
import './App.css';
import LoginIcon from "../imgs/login-icon.png"

function App() {
  return (
    <div className="app">
      <div className="wallpaper">
        <img src={LoginIcon} alt="login-icon"></img>
      </div>
      <div className="form">

      </div>
    </div>
  );
}

export default App;
